            float obstacleAngle = Vector3.Angle(direction, obstacleDirection);
            Vector3 newDirection = Vector3.Cross(direction, obstacleDirection).normalized;
            newDirection = Quaternion.Euler(0, obstacleAngle, 0) * newDirection;

            \/\/ Update the flee direction
