Yes, you can conditionally make a query with `useQuery` by using the optional `enabled` prop.

The `enabled` prop is a boolean value that determines whether the query should be executed or not. If `enabled` is `false`, the query will not be executed, and the query's data will remain in its current state.

Here's an example:
```jsx
import { useQuery } from 'react-query';

function MyComponent() {
  const [someVariable, setSomeVariable] = useState(false);

  const { data, isLoading, isError } = useQuery(
    'myQuery',
    () => fetch('\/api\/data').then(res => res.json()),
    {
      enabled: someVariable,
    }
  );

  \/\/ ...
}
```
In this example, the `useQuery` hook is used to make a request to the `\/api\/data` endpoint. The `enabled` prop is set to `someVariable`, which is a state variable that can be toggled to determine whether the query should be executed or not.

If `someVariable` is `false`, the query will not be executed, and the `data` and `isLoading` values will remain in their current state. If `someVariable` is `true`, the query will be executed, and the `data` and `isLoading` values will be updated accordingly.

