import { Data } from '.\/types'; \/\/ Assuming you have a Data type defined for your data

const ExpandableRow = ({ data }: { data: Data }) => {
  const [isExpanded, setIsExpanded] = useState(false);

  return (
    <div>
      <button onClick={() => setIsExpanded(!isExpanded)}>
        {isExpanded ? 'Collapse' : 'Expand'}
      <\/button>
