                <Cell key={index} fill={COLORS[index % COLORS.length]} \/>
              ))}
            <\/Bar>
          <\/BarChart>
        <\/ResponsiveContainer>
      <\/div>
    <\/div>
  );
};

const YourComponent = () => {
  const data = [
    \/\/ Your data array
  ];

