using System.Collections;
using System.Collections.Generic;
using UnityEngine;

public class RatBehavior : MonoBehaviour
{
    [SerializeField] private LayerMask obstacleLayer;
    public float detectionRadius = 5f;
    public AudioClip ratSound;
    private GameObject player;
    private Vector3 initialPosition;
    private Animation animation;
    private AudioSource audioSource;


    void Start()
    {
        player = GameObject.Find("Player");
        initialPosition = transform.position;
        obstacleLayer = LayerMask.GetMask("Obstacle");
        animation = GetComponent<Animation>();
        audioSource = GetComponent<AudioSource>();
    }

    void Update()
    {
        float distanceToPlayer = Vector3.Distance(transform.position, player.transform.position);

        if (distanceToPlayer <= detectionRadius)
        {
            \/\/ Flee from the player, avoiding obstacles
            Vector3 fleeDirection = (transform.position - player.transform.position).normalized;
            if (AvoidObstacles(fleeDirection))
            {
                transform.position += fleeDirection * Time.deltaTime * 5f;
                RotateTowards(transform.position + fleeDirection);
            }
        }
        else if (distanceToPlayer > detectionRadius + 1f) \/\/ Add a buffer zone
        {
            \/\/ Return to the initial position
            transform.position = Vector3.MoveTowards(transform.position, initialPosition, Time.deltaTime * 5f);
            RotateTowards(initialPosition);
        }

        float distanceToInitialPosition = Vector3.Distance(transform.position, initialPosition);

        if (distanceToPlayer <= detectionRadius || (distanceToPlayer > detectionRadius + 1f && distanceToInitialPosition > 0.1f))
        {
            if (!animation.IsPlaying("walk"))
            {
                animation.CrossFade("walk");
            }
        }
        else
        {
            if (!animation.IsPlaying("idle"))
            {
                animation.CrossFade("idle");
            }
        }
    }

    private bool AvoidObstacles(Vector3 direction)
    {
        \/\/ Raycast parameters
        RaycastHit hit;
        Vector3 origin = transform.position + (direction * 0.5f);
        Vector3 end = origin + direction * 2f;
        float raycastDistance = Vector3.Distance(origin, end);

        \/\/ Perform the raycast
        if (Physics.Raycast(origin, direction, out hit, raycastDistance, obstacleLayer))
        {
            \/\/ Obstacle found, calculate new direction
            Vector3 obstaclePosition = hit.point;
            Vector3 obstacleDirection = (obstaclePosition - origin).normalized;
            float obstacleAngle = Vector3.Angle(direction, obstacleDirection);
            Vector3 newDirection = Vector3.Cross(direction, obstacleDirection).normalized;
            newDirection = Quaternion.Euler(0, obstacleAngle, 0) * newDirection;

            \/\/ Update the flee direction
            direction = new Vector3(newDirection.x, 0, newDirection.z).normalized;
        }

        \/\/ Return true if a new direction was calculated, false otherwise
        return (direction != Vector3.zero);
    }

    private void RotateTowards(Vector3 target)
    {
        Vector3 direction = (target - transform.position).normalized;
        RaycastHit hit;
        Vector3 up = Vector3.up;

        \/\/ Raycast downwards to detect the terrain's normal
        if (Physics.Raycast(transform.position, -Vector3.up, out hit))
        {
            up = hit.normal;
        }

        Quaternion toRotation = Quaternion.LookRotation(new Vector3(direction.x, 0, direction.z), up);
        transform.rotation = toRotation;
    }
}

